    const past = [];
    const future = [];
    let currentPage = '';
    const setCurrentPage = (page) => {
        if (!page) return;
        currentPage = page;
    };
    const goForwards = () => {
        if (!future.length) return;
        past.push(currentPage);
        setCurrentPage(future.pop());
    };
    const goBackwards = () => {
        if (!past.length) return;
        future.push(currentPage);
        setCurrentPage(past.pop());
    };
